import React from 'react';
import ReactDOM from 'react-dom/client'; // Import modificato per React 18
import './index.css';
import App from './App';
import { reportWebVitals } from './reportWebVitals';


// Nuovo modo di rendere l'app con React 18
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// Opzionale: reportWebVitals per analizzare le prestazioni dell'app
reportWebVitals();
